mmifères avec cette nouvelle série de courts-métrages. L’occasion de faire plus ample connaissance avec quelques personnages intrigants, dont Fru Fru, la musaraigne arctique toujours très tendance ; l’officier Clawhauser, le guépard gourmand ou encore Flash, le surprenant paresseux !\",\"poster_path\":\"/mDWJLXnqDLw2UP5s0p8KvGiAm4w.jpg\",\"media_type\":\"tv\",\"genre_ids\":[16,10751,10759],\"popularity\":186.015,\"first_air_date\":\"2022-11-09\",\"vote_average\":7.707,\"vote_count\":70,\"origin_country\":[\"US\"]},{\"adult\":false,\"backdrop_path\":\"/mBxsapX4DNhH1XkOlLp15He5sxL.jpg\",\"id\":37854,\"name\":\"One Piece\",\"original_language\":\"ja\",\"original_name\":\"ワンピース\",\"overview\":\"Il fut un temps où Gold Roger était le plus grand de tous les pirates, le \\\"Roi des Pirates\\\" était son surnom. A sa mort, son trésor d'une valeur inestimable connu sous le nom de \\\"One Piece\\\" fut caché quelque part sur \\\"Grand Line\\\". De nombreux pirates sont partis à la recherche de ce trésor mais tous sont morts avant même de l'atteindre. Monkey D. Luffy rêve de retrouver ce trésor légendaire et de devenir le nouveau \\\"Roi des Pirates\\\". Après avoir mangé un fruit du démon, il possède un pouvoir lui permettant de réaliser son rêve. Il lui faut maintenant trouver un équipage pour partir à l'aventure !\",\"poster_path\":\"/e3NBGiAifW9Xt8xD5tpARskjccO.jpg\",\"media_type\":\"tv\",\"genre_ids\":[10759,35,16],\"popularity\":96.542,\"first_air_date\":\"1999-10-20\",\"vote_average\":8.7,\"vote_count\":3410,\"origin_country\":[\"JP\"]},{\"adult\":false,\"backdrop_path\":\"/suopoADq0k8YZr4dQXcU6pToj6s.jpg\",\"id\":1399,\"name\":\"Game of Thrones\",\"original_language\":\"en\",\"original_name\":\"Game of Thrones\",\"overview\":\"Il y a très longtemps, à une époque oubliée, une force a détruit l'équilibre des saisons. Dans un pays où l'été peut durer plusieurs années et l'hiver toute une vie, des forces sinistres et surnaturelles se pressent aux portes du Royaume des Sept Couronnes. La confrérie de la Garde de Nuit, protégeant le Royaume de toute créature pouvant provenir d'au-delà du Mur protecteur, n'a plus les ressources nécessaires pour assurer la sécurité de tous. Après un été de dix années, un hiver rigoureux s'abat sur le Royaume avec la promesse d'un avenir des plus sombres. Pendant ce temps, complots et rivalités se jouent sur le continent pour s'emparer du Trône de fer, le symbole du pouvoir absolu.\",\"poster_path\":\"/3YSdxdhhdCDlMs88RhvjhDLX4CA.jpg\",\"media_type\":\"tv\",\"genre_ids\":[10765,18,10759],\"popularity\":655.097,\"first_air_date\":\"2011-04-17\",\"vote_average\":8.43,\"vote_count\":19839,\"origin_country\":[\"US\"]},{\"adult\":false,\"backdrop_path\":\"/6nQNLJEv4PgJlck3G4FIB4vJ99o.jpg\",\"id\":76669,\"name\":\"Elite\",\"original_language\":\"es\",\"original_name\":\"Élite\",\"overview\":\"Las Encinas est l’école la plus compétitive et huppée d’Espagne, accueillant les enfants de l’élite espagnole. C’est également dans cette école que sont admis trois adolescents boursiers, issus de la classe ouvrière, lorsque leur lycée s'effondre et que les élèves sont répartis dans plusieurs établissements scolaires. Ils s'estiment chanceux… mais peut-être ne le sont-ils pas tant que cela ? La confrontation entre ceux qui ont tout et ceux qui n’ont rien est explosive, et les tensions de classes sociales aboutiront à un meurtre. Qui se cache réellement derrière ce crime ? Est-ce l’un des nouveaux arrivants ? Ou se cache-t-il quelque chose de bien plus sombre ?\",\"poster_path\":\"/sv4ZhtVC1v44EqKsF8aOoGtvKj0.jpg\",\"media_type\":\"tv\",\"genre_ids\":[80,9648,18],\"popularity\":868.443,\"first_air_date\":\"2018-10-05\",\"vote_average\":8.108,\"vote_count\":8509,\"origin_country\":[\"ES\"]},{\"adult\":false,\"backdrop_path\":\"/eafpQ9WJu1BQ28VQsNyL9xsGrtK.jpg\",\"id\":155631,\"name\":\"Super Noël, la série\",\"original_language\":\"en\",\"original_name\":\"The Santa Clauses\",\"overview\":\"Scott Calvin est de retour, et son entrain n'en a pas pris un coup, malgré 30 ans de bons et loyaux services. Mais tandis que l'esprit de Noël est sur le déclin, sa magie s'en trouve affectée. Scott a de plus en plus de difficultés à concilier son rôle de père Noël avec celui de père de famille. La découverte d'une nouvelle clause lui permettant de prendre sa retraite et de se consacrer pleinement à sa famille l'encourage à trouver un successeur à la hauteur du rôle.\",\"poster_path\":\"/jAgAixvkEGdwIm3cdqmYJutNRSD.jpg\",\"media_type\":\"tv\",\"genre_ids\":[35,10751],\"popularity\":106.391,\"first_air_date\":\"2022-11-16\",\"vote_average\":7.708,\"vote_count\":24,\"origin_country\":[\"US\"]},{\"adult\":false,\"backdrop_path\":\"/1rO4xoCo4Z5WubK0OwdVll3DPYo.jpg\",\"id\":84773,\"name\":\"Le Seigneur des anneaux : Les Anneaux de pouvoir\",\"original_language\":\"en\",\"original_name\":\"The Lord of the Rings: The Rings of Power\",\"overview\":\"Divers personnages, connus et inconnus, doivent faire face à la résurgence du mal en Terre du Milieu. Des profondeurs des Montagnes de Brume aux forêts majestueuses du Lindon, de l'île des Rois de Númenor aux contrées les plus éloignées du monde, ces royaumes et personnages vont forger un héritage qui demeurera bien après leur disparition.\",\"poster_path\":\"/gpHezxjqAnZ21o8T9vSSrUKygQ3.jpg\",\"media_type\":\"tv\",\"genre_ids\":[10765,10759,18],\"popularity\":785.659,\"first_air_date\":\"2022-09-01\",\"vote_average\":7.605,\"vote_count\":1556,\"origin_country\":[\"US\"]},{\"adult\":false,\"backdrop_path\":\"/uGy4DCmM33I7l86W7iCskNkvmLD.jpg\",\"id\":60625,\"name\":\"Rick et Morty\",\"original_language\":\"en\",\"original_name\":\"Rick and Morty\",\"overview\":\"Rick est un scientifique âgé et déséquilibré qui a récemment renoué avec sa famille. Il passe le plus clair de son temps à entraîner son petit-fils Morty dans des aventures extraordinaires et dangereuses, à travers l'espace et dans des univers parallèles. Ajoutés à la vie de famille déjà instable de Morty, ces événements n'amènent qu'un surcroît de stress pour Morty, à la maison et à l'école...\",\"poster_path\":\"/s11re4xQLZ6pRPv2sqXnK8CCvGn.jpg\",\"media_type\":\"tv\",\"genre_ids\":[16,35,10765,10759],\"popularity\":1015.424,\"first_air_date\":\"2013-12-02\",\"vote_average\":8.731,\"vote_count\":7435,\"origin_country\":[\"US\"]},{\"adult\":false,\"backdrop_path\":\"/eenxjEAPwPbkjN6W5ZzTbfLA4GM.jpg\",\"id\":99346,\"name\":\"The English\",\"original_language\":\"en\",\"original_name\":\"The English\",\"overview\":\"Une Anglaise aristocratique, Lady Cornelia Locke, arrive dans le paysage nouveau et sauvage de l'Ouest pour se venger de l'homme qu'elle considère comme responsable de la mort de son fils.\",\"poster_path\":\"/ij8fcZztnpyN6ooC1v1NSoGe22n.jpg\",\"media_type\":\"tv\",\"genre_ids\":[18,37],\"popularity\":63.234,\"first_air_date\":\"2022-11-10\",\"vote_average\":7.6,\"vote_count\":31,\"origin_country\":[\"GB\"]},{\"adult\":false,\"backdrop_path\":\"/yreuPT1RYFvWkQ3gjnjRP8vAq3o.jpg\",\"id\":120089,\"name\":\"SPYxFAMILY\",\"original_language\":\"ja\",\"original_name\":\"SPY×FAMILY\",\"overview\":\"Twilight, le plus grand espion du monde, vient de recevoir une mission de la plus haute importance, nom de code : Opération STRIX.\\n\\nSon objectif : s’approcher de Donovan Desmond, le chef du parti « Nation Unifiée », afin d’enquêter sur ses projets politiques douteux.\\n\\nPour y parvenir, notre agent super secret doit fonder une famille de toute pièce afin de s’introduire dans l’école Eden : la plus prestigieuse école de toute l’aristocratie, dans laquelle étudie le fils de sa cible.\\n\\nTotalement dépourvu d’expérience familiale, Twilight adopte une petite fille dont il ignore tout des dons de télépathie, et s’associe à une jeune femme à l’allure timide : en réalité une redoutable tueuse à gage.\\n\\nCe trio hors du commun va devoir tout mettre en œuvre afin de ressembler à une famille unie et aimante… Il en va de la réussite de l’opération STRIX, et de l’avenir du pays tout entier.\",\"poster_path\":\"/3r4LYFuXrg3G8fepysr4xSLWnQL.jpg\",\"media_type\":\"tv\",\"genre_ids\":[16,35,10759],\"popularity\":623.547,\"first_air_date\":\"2022-04-09\",\"vote_average\":8.699,\"vote_count\":944,\"origin_country\":[\"JP\"]}],\"total_pages\":1000,\"total_results\":20000}"

