e de chiffres et de lettres sans signification apparente. Œuvre cohérente d’une malade, ou cryptogramme ?\",\"poster_path\":\"/fQ0vGVTtxjCdAJnxwPZ88O3Wzrh.jpg\",\"media_type\":\"movie\",\"genre_ids\":[18,53,9648],\"popularity\":57.203,\"release_date\":\"2010-02-14\",\"video\":false,\"vote_average\":8.192,\"vote_count\":20787},{\"adult\":false,\"backdrop_path\":\"/74pgiTEwbgKdPBkhR000wQd1ywI.jpg\",\"id\":106646,\"title\":\"Le Loup de Wall Street\",\"original_language\":\"en\",\"original_title\":\"The Wolf of Wall Street\",\"overview\":\"L'histoire vraie de Jordan Belfort, un courtier en bourse qui passa vingt mois en prison pour avoir refusé de participer à une gigantesque arnaque, dévoilant la corruption et l'implication de la pègre qui sévissait à Wall Street et au-delà des États-Unis. L’argent, le pouvoir, les femmes, la drogue, les tentations étaient là, à portée de main, et les autorités n’avaient aucune prise. Aux yeux de Jordan et de sa meute, la modestie était devenue complètement inutile. Trop n’était jamais assez…\",\"poster_path\":\"/dQIQZbJXn1pflQw3nwvXLJX0dHa.jpg\",\"media_type\":\"movie\",\"genre_ids\":[80,18,35],\"popularity\":137.137,\"release_date\":\"2013-12-25\",\"video\":false,\"vote_average\":8.033,\"vote_count\":20655},{\"adult\":false,\"backdrop_path\":\"/9RuC3UD6mNZ0p1J6RbfJDUkQ03i.jpg\",\"id\":1422,\"title\":\"Les Infiltrés\",\"original_language\":\"en\",\"original_title\":\"The Departed\",\"overview\":\"À Boston, une lutte sans merci oppose la police à la pègre irlandaise. Pour mettre fin au règne du parrain Frank Costello, la police infiltre son gang avec «un bleu» issu des bas quartiers, Billy Costigan. Tandis que Billy s’efforce de gagner la confiance du malfrat vieillissant, Colin Sullivan entre dans la police au sein de l’Unité des Enquêtes Spéciales, chargée d’éliminer Costello. Mais Colin fonctionne en «sous‐marin» et informe Costello des opérations qui se trament contre lui. Risquant à tout moment d’être démasqués, Billy et Colin son