ntry\":[\"US\"],\"original_language\":\"en\",\"original_name\":\"Black Box\",\"overview\":\"Catherine Black is a world-famous neurologist at the state-of-the-art medical institution known as \\\"The Cube\\\". Catherine is brilliant, beautiful, and at the top of her game, though she's hiding a secret of her own: she's bipolar. Each week, the doctors on staff attempt to unravel the mysteries of the brain and are constantly challenged by cases never-before-seen on television. The medical stories are moving, bizarre and a visual feast. The personal stories are riveting. The patients have rare, highly visual, often hallucinogenic and startling conditions, which we’ll see through their eyes as Catherine diagnoses and treats them.\",\"popularity\":9.119,\"poster_path\":\"/bjfxUhq0IflP9OOsZ19SOVAmhDR.jpg\",\"vote_average\":6.3,\"vote_count\":19},{\"backdrop_path\":\"/gzhei21zGwh5Cum2tuSIdjmi7AG.jpg\",\"first_air_date\":\"2022-10-28\",\"genre_ids\":[10759,18,10765],\"id\":135822,\"name\":\"Kamen Rider Black Sun\",\"origin_country\":[\"JP\"],\"original_language\":\"ja\",\"original_name\":\"仮面ライダーBLACK SUN\",\"overview\":\"A remake of the highly popular Kamen Rider Black series has been announced. A new interpretation of a story steeped in the pathos of the hero’s harsh fate, Kamen Rider Black returns to the screen after a hiatus of more than 30 years, reincarnated as Kamen Rider Black Sun.\",\"popularity\":16.898,\"poster_path\":\"/cPE8NR9CdpZKHab3ZSyVy4R6vGz.jpg\",\"vote_average\":9.1,\"vote_count\":32},{\"backdrop_path\":\"/tH2YU67rhECyNGC8fV0S6YtIlyR.jpg\",\"first_air_date\":\"1997-10-11\",\"genre_ids\":[16,10759,35],\"id\":1153,\"name\":\"Men in Black: The Series\",\"origin_country\":[\"US\"],\"original_language\":\"en\",\"original_name\":\"Men in Black: The Series\",\"overview\":\"Men in Black: The Series, also known as MIB: The Series and Men in Black: The Animated Series, is an American animated television series that originally aired on The WB's Kids' WB programming b